import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import DeleteModal from '../../component2/DeleteModal';
import { geomanagementApi } from '../../service/api';
import translator from '../../Translator/translator';
import { EditOutlined } from '@ant-design/icons';
import PrvnTable from '../../component2/PrvnTable';

function Province(props) {
    const [dataSource, setDataSource] = useState([])
    const [name, setName] = useState(undefined)

    useEffect(() => {
        const params = { name: name }
        if (name !== undefined) {
            geomanagementApi.get("/provinces", { params: params }).then((res) => {
                setDataSource(res.data.data)
            })
        }

    }, [name])

    const columns = [{
        title: 'nameLocal',
        dataIndex: 'localName',
        key: '1',
    },
    {
        title: 'otherName',
        dataIndex: 'otherName',
        key: '2',
    },
    {
        title: 'enName',
        dataIndex: 'enName',
        key: '3',
    },
    {
        title: 'createTime',
        dataIndex: 'createTime',
        key: '4',
    },
    {
        title: translator('Action'),
        key: 'action',
        render: (text, record) => (
            <Link
                to={{
                    pathname: `/provinces/${record.id}/edit`,
                    state: { id: record.id }
                }}
            >
                <EditOutlined />
            </Link>
        ),
    },
    {
        title: 'deleted',
        dataIndex: 'deleted',
        key: 'deleted',
        render: (text, record) => {
            return <>
                <DeleteModal id={record.id} type={"provinces"} />
            </>
        }
    },
    ]


    return (
        <div>
            <span> name</span>
            <input onChange={(e) => setName(e.target.value)} />
            {name == undefined ? <> برای مشاهده لیست باید بخشی از نام را وارد کنید</> : ""}
            <PrvnTable
                dataSource={dataSource}
                columns={columns}
                pagination={false}
            >
            </PrvnTable>
        </div>
    );
}
export default Province;
